GABAは一般的にストレス緩和、リラックス効果、疲労感の軽減など、副交感神経を優位にさせる効果があり、それに伴い様々な効能効果が期待されています。GABAの世界売上No1である日本の企業「ファーマフーズ」の研究では、新たに認知機能の向上も発見されたようです。

ますますGABA活躍の場が拡大される期待が持たれます。

